import React, { useState, useContext } from 'react';
import axios from 'axios';
import '../App.css';

const UserSurveyDetails = () => {
    const [mobileNumber, setMobileNumber] = useState('');
      const [data, setData] = useState(null);
      const [loading, setLoading] = useState(false);
    
      const handleSearch = async () => {
        if (!mobileNumber) {
          alert('Please enter a mobile number.');
          return;
        }
    
        setLoading(true);

        try {
            const response = await axios.post('https://babralaapi-d3fpaphrckejgdd5.centralindia-01.azurewebsites.net/auth/data', {
              MobileNumber: mobileNumber,
            });
      
            if (response.data) {
              setData(response.data);
              console.log('Data:', response.data);
            } else {
              alert('No data found.');
            }
          } catch (error) {
            if (error.response && error.response.status === 204) {
              alert('No owner found.');
            } else {
              console.error('Error fetching data:', error);
              alert('An error occurred while fetching data.');
            }
          } finally {
            setLoading(false);
          }
        };



  return (
    <div className="container">
      <div className="content">
        <h1>Find Owner Details</h1>
        <input
          className="input"
          placeholder="Enter Mobile Number"
          value={mobileNumber}
          onChange={(e) => setMobileNumber(e.target.value)}
          type="text"
        />
        <button className="button" onClick={handleSearch} disabled={loading}>
          {loading ? 'Searching...' : 'Search'}
        </button>



        {data && (
          <div className="displayContent">
            <h2>Owner Info</h2>
            <div className="displayTable">
              <div className="displayRow">
                <span className="displayCellHeader">First Name</span>
                <span className="displayCell">{data.owner.FirstName || 'N/A'}</span>
              </div>
              <div className="displayRow">
                <span className="displayCellHeader">Middle Name</span>
                <span className="displayCell">{data.owner.MiddleName || 'N/A'}</span>
              </div>
              <div className="displayRow">
                <span className="displayCellHeader">Last Name</span>
                <span className="displayCell">{data.owner.LastName || 'N/A'}</span>
              </div>
              <div className="displayRow">
                <span className="displayCellHeader">Father Name</span>
                <span className="displayCell">{data.owner.FatherName || 'N/A'}</span>
              </div>
              <div className="displayRow">
                <span className="displayCellHeader">Mobile Number</span>
                <span className="displayCell">{data.owner.MobileNumber || 'N/A'}</span>
              </div>
              <div className="displayRow">
                <span className="displayCellHeader">Occupation</span>
                <span className="displayCell">{data.owner.Occupation || 'N/A'}</span>
              </div>
              <div className="displayRow">
                <span className="displayCellHeader">Age</span>
                <span className="displayCell">{data.owner.Age || 'N/A'}</span>
              </div>
              <div className="displayRow">
                <span className="displayCellHeader">DOB</span>
                <span className="displayCell">{data.owner.DOB || 'N/A'}</span>
              </div>
              <div className="displayRow">
                <span className="displayCellHeader">Gender</span>
                <span className="displayCell">{data.owner.Gender || 'N/A'}</span>
              </div>
              <div className="displayRow">
                <span className="displayCellHeader">Income</span>
                <span className="displayCell">{data.owner.Income || 'N/A'}</span>
              </div>
              <div className="displayRow">
                <span className="displayCellHeader">Religion</span>
                <span className="displayCell">{data.owner.Religion || 'N/A'}</span>
              </div>
              <div className="displayRow">
                <span className="displayCellHeader">Category</span>
                <span className="displayCell">{data.owner.Category || 'N/A'}</span>
              </div>
              <div className="displayRow">
                <span className="displayCellHeader">Email</span>
                <span className="displayCell">{data.owner.Email || 'N/A'}</span>
              </div>
              <div className="displayRow">
                <span className="displayCellHeader">Pan Card Number</span>
                <span className="displayCell">{data.owner.PanNumber || 'N/A'}</span>
              </div>
              <div className="displayRow">
                <span className="displayCellHeader">Adhar Card Number</span>
                <span className="displayCell">{maskAadhaarNumber(data.owner.AdharNumber)}</span>
              </div>
              <div className="displayRow">
                <span className="displayCellHeader">Number Of Members</span>
                <span className="displayCell">{data.owner.NumberOfMembers || 'N/A'}</span>
              </div>
              <div className="displayRow">
                <span className="displayCellHeader">Created By</span>
                <span className="displayCell">{data.owner.CreatedBy || 'N/A'}</span>
              </div>
              <div className="displayRow">
                <span className="displayCellHeader">Modified By</span>
                <span className="displayCell">{data.owner.UserModifiedBy || 'N/A'}</span>
              </div>
              <div className="displayRow">
                <span className="displayCellHeader">Active Status</span>
                <button
                  className={`statusButton ${data.owner.UserIsActive ? 'active' : 'inactive'}`}
                  onClick={console.log('Active Status')}
                >
                  {data.owner.UserIsActive ? 'Active' : 'Inactive'}
                </button>
              </div>
            </div>
          </div>
        )}
      </div>
    </div>    
  )
}

export default UserSurveyDetails;
